import React from 'react'
import TreeView from '@material-ui/lab/TreeView'
import TreeItem from '@material-ui/lab/TreeItem'
import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles({
  root_nav: {
    display: 'flex',
    flex: 'row',
    maxWidth: '800px',
  },
})

export default function FileSystemNavigator() {
  const classes = useStyles()

  return (
    <TreeView className={classes.root_nav}>
      <TreeItem nodeId="1" label="購物車" className={classes.root_nav}>
        <TreeItem nodeId="2" label="活動" className={classes.root_nav} />
        <TreeItem nodeId="3" label="課程" className={classes.root_nav} />
      </TreeItem>
      <TreeItem nodeId="5" label="未付款" className={classes.root_nav}>
        <TreeItem nodeId="10" label="活動" className={classes.root_nav} />
        <TreeItem
          nodeId="6"
          label="課程"
          className={classes.root_nav}
        ></TreeItem>
      </TreeItem>
    </TreeView>
  )
}
